import React from 'react';
import { Anchor } from 'antd';
const { Link } = Anchor;

function NavIcon ({title, iconStyle, NavTabText, NavTabStyle, href}) {
    
    
    return (
        <div>
            <button style={iconStyle}>
                <Anchor style={NavTabStyle}>
                    <Link title={title} style={NavTabText} className="NavTab__button-text" href={href} ></Link>
                </Anchor>
            </button>
        </div>
    );
}

export default NavIcon;
